import HeaderOnly from "./components/Layout/HeaderOnly";
import USER from "./components/User";
import Coins from "./pages/Coins";
import Explore from "./pages/Explore";
import Following from "./pages/Following";
import Help from "./pages/Help";
import Home from "./pages/Home";
import Live from "./pages/Live";
import Profile from "./pages/Profile";
import Settings from "./pages/Settings";
import Upload from "./pages/Upload";

const publicRoutes = [
    {
        path: '/',
        component: Home,
    },
    {
        path: '/@:nickname',
        component: Following, 
        // layout: null
    }, 
    {
        path: '/upload',
        component: Upload,
        layout: HeaderOnly
    },
    {
        path: '/explore',
        component: Explore,
        // layout: HeaderOnly
    },
    {
        path: '/live',
        component: Live,
        // layout: HeaderOnly
    },
    {
        path: `/${USER.id_user}`,
        component: Profile
    },
    {
        path: '/settings',
        component: Settings,
        layout: HeaderOnly
    },
    {
        path: '/coins',
        component: Coins,
        layout: HeaderOnly
    },
    {
        path: '/help',
        component: Help,
        layout: HeaderOnly
    }
]

export {publicRoutes};
